}

static void talk_to_set_up_fidget(int headFrmId, int reaction)
{
    // 0x505228
    static int phone_anim = 0;

    fidgetFrameCounter = 0;

    if (headFrmId == -1) {
        fidgetFID = -1;
        fidgetFp = NULL;
        fidgetKey = INVALID_CACHE_ENTRY;
        fidgetAnim = -1;
        fidgetTocksPerFrame = 0;
        fidgetLastTime = 0;
        talk_to_display_frame(NULL, 0);
        lipsFID = 0;
        lipsKey = NULL;
        lipsFp = 0;
        return;
    }

    int anim = HEAD_ANIMATION_NEUTRAL_PHONEMES;
    switch (reaction) {
    case FIDGET_GOOD:
        anim = HEAD_ANIMATION_GOOD_PHONEMES;
        break;
    case FIDGET_BAD:
        anim = HEAD_ANIMATION_BAD_PHONEMES;
        break;
    }

    if (lipsFID != 0) {
        if (anim != phone_anim) {
            if (art_ptr_unlock(lipsKey) == -1) {
                debug_printf("failure unlocking lips frame!\n");
            }
            lipsKey = NULL;
            lipsFp = NULL;
            lipsFID = 0;
        }
    }

    if (lipsFID == 0) {
        phone_anim = anim;
        lipsFID = art_id(OBJ_TYPE_HEAD, headFrmId, anim, 0, 0);
        lipsFp = art_ptr_lock(lipsFID, &lipsKey);
        if (lipsFp == NULL) {
            debug_printf("failure!\n");

            char stats[200];
            cache_stats(&art_cache, stats, sizeof(stats));
            debug_printf("%s", stats);
        }
    }

    int fid = art_id(OBJ_TYPE_HEAD, headFrmId, reaction, 0, 0);
    int fidgetCount = art_head_fidgets(fid);
    if (fidgetCount == -1) {
        debug_printf("\tError - No available fidgets for given frame id\n");
        return;
    }

    int chance = roll_random(1, 100) + dialogue_seconds_since_last_input / 2;

    int fidget = fidgetCount;
    switch (fidgetCount) {
    case 1:
        fidget = 1;
        break;
    case 2:
        if (chance < 68) {
            fidget = 1;
        } else {
            fidget = 2;
        }
        break;
    case 3:
        dialogue_seconds_since_last_input = 0;
        if (chance < 52) {
            fidget = 1;
        } else if (chance < 77) {
            fidget = 2;
        } else {
            fidget = 3;
        }
        break;
    }

    debug_printf("Choosing fidget %d out of %d\n", fidget, fidgetCount);

    if (fidgetFp != NULL) {
        if (art_ptr_unlock(fidgetKey) == -1) {
            debug_printf("failure!\n");
        }
    }

    fidgetFID = art_id(OBJ_TYPE_HEAD, headFrmId, reaction, fidget, 0);
    fidgetFrameCounter = 0;
    fidgetFp = art_ptr_lock(fidgetFID, &fidgetKey);
    if (fidgetFp == NULL) {
        debug_printf("failure!\n");

        char stats[200];
        cache_stats(&art_cache, stats, sizeof(stats));
        debug_printf("%s", stats);
    }

    fidgetLastTime = 0;
    fidgetAnim = reaction;
    fidgetTocksPerFrame = 1000 / art_frame_fps(fidgetFp);
}

static void talk_to_play_transition(int anim)
{
    if (fidgetFp == NULL) {
        return;
    }

    if (dialogueWindow == -1) {
        return;
    }

    mouse_hide();

    debug_printf("Starting transition...\n");

    talk_to_wait_for_fidget();

    if (fidgetFp != NULL) {
        if (art_ptr_unlock(fidgetKey) == -1) {
            debug_printf("\tError unlocking fidget in transition func...");
        }
        fidgetFp = NULL;
    }

    CacheEntry* headFrmHandle;
    int headFid = art_id(OBJ_TYPE_HEAD, dialogue_head, anim, 0, 0);
    Art* headFrm = art_ptr_lock(headFid, &headFrmHandle);
    if (headFrm == NULL) {
        debug_printf("\tError locking transition...\n");
    }

    unsigned int delay = 1000 / art_frame_fps(headFrm);

    int frame = 0;
    unsigned int time = 0;
    while (frame < art_frame_max_frame(headFrm)) {
        sharedFpsLimiter.mark();

        if (elapsed_time(time) >= delay) {
            talk_to_display_frame(headFrm, frame);
            time = get_time();
            frame++;
        }

        renderPresent();
        sharedFpsLimiter.throttle();
    }

    if (art_ptr_unlock(headFrmHandle) == -1) {
        debug_printf("\tError unlocking transition...\n");
    }

    debug_printf("Finished transition...\n");
    mouse_show();
}

int gmouse_set_cursor(int cursor)
{
    if (!gmouse_initialized) {
        return -1;
    }

    if (cursor != MOUSE_CURSOR_ARROW && cursor == gmouse_current_cursor && (gmouse_current_cursor < 25 || gmouse_current_cursor >= 27)) {
        return -1;
    }

    CacheEntry* mouseCursorFrmHandle;
    int fid = art_id(OBJ_TYPE_INTERFACE, gmouse_cursor_nums[cursor], 0, 0, 0);
    Art* mouseCursorFrm = art_ptr_lock(fid, &mouseCursorFrmHandle);
    if (mouseCursorFrm == NULL) {
        return -1;
    }

    bool shouldUpdate = true;
    int frame = 0;
    if (cursor >= FIRST_GAME_MOUSE_ANIMATED_CURSOR) {
        unsigned int tick = get_time();

        if (gmouse_3d_is_on()) {
            gmouse_3d_off();
        }

        unsigned int delay = 1000 / art_frame_fps(mouseCursorFrm);
        if (elapsed_tocks(tick, gmouse_wait_cursor_time) < delay) {
            shouldUpdate = false;
        } else {
            if (art_frame_max_frame(mouseCursorFrm) <= gmouse_wait_cursor_frame) {
                gmouse_wait_cursor_frame = 0;
            }

            frame = gmouse_wait_cursor_frame;
            gmouse_wait_cursor_time = tick;
            gmouse_wait_cursor_frame++;
        }
    }

    if (!shouldUpdate) {
        return -1;
    }

    int width = art_frame_width(mouseCursorFrm, frame, 0);
    int height = art_frame_length(mouseCursorFrm, frame, 0);

    int offsetX;
    int offsetY;
    art_frame_offset(mouseCursorFrm, 0, &offsetX, &offsetY);

    offsetX = width / 2 - offsetX;
    offsetY = height - 1 - offsetY;

    unsigned char* mouseCursorFrmData = art_frame_data(mouseCursorFrm, frame, 0);
    if (mouse_set_shape(mouseCursorFrmData, width, height, width, offsetX, offsetY, 0) != 0) {
        return -1;
    }

    if (gmouse_current_cursor_key != INVALID_CACHE_ENTRY) {
        art_ptr_unlock(gmouse_current_cursor_key);
    }

    gmouse_current_cursor = cursor;
    gmouse_current_cursor_key = mouseCursorFrmHandle;

    return 0;
}

void intface_end_window_open(bool animated)
{
    if (interfaceWindow == -1) {
        return;
    }

    if (endWindowOpen) {
        return;
    }

    int fid = art_id(OBJ_TYPE_INTERFACE, 104, 0, 0, 0);
    CacheEntry* handle;
    Art* art = art_ptr_lock(fid, &handle);
    if (art == NULL) {
        return;
    }

    int frameCount = art_frame_max_frame(art);
    gsound_play_sfx_file("iciboxx1");

    if (animated) {
        unsigned int delay = 1000 / art_frame_fps(art);
        int time = 0;
        int frame = 0;
        while (frame < frameCount) {
            sharedFpsLimiter.mark();

            if (elapsed_time(time) >= delay) {
                unsigned char* src = art_frame_data(art, frame, 0);
                if (src != NULL) {
                    buf_to_buf(src, 57, 58, 57, interfaceBuffer + 640 * 38 + 580, 640);
                    win_draw_rect(interfaceWindow, &endWindowRect);
                }

                time = get_time();
                frame++;
            }
            gmouse_bk_process();

            renderPresent();
            sharedFpsLimiter.throttle();
        }
    } else {
        unsigned char* src = art_frame_data(art, frameCount - 1, 0);
        buf_to_buf(src, 57, 58, 57, interfaceBuffer + 640 * 38 + 580, 640);
        win_draw_rect(interfaceWindow, &endWindowRect);
    }

    art_ptr_unlock(handle);

    endWindowOpen = true;
    intface_create_end_turn_button();
    intface_create_end_combat_button();
    intface_end_buttons_disable();
}

void intface_end_window_close(bool animated)
{
    if (interfaceWindow == -1) {
        return;
    }

    if (!endWindowOpen) {
        return;
    }

    int fid = art_id(OBJ_TYPE_INTERFACE, 104, 0, 0, 0);
    CacheEntry* handle;
    Art* art = art_ptr_lock(fid, &handle);
    if (art == NULL) {
        return;
    }

    intface_destroy_end_turn_button();
    intface_destroy_end_combat_button();
    gsound_play_sfx_file("icibcxx1");

    if (animated) {
        unsigned int delay = 1000 / art_frame_fps(art);
        unsigned int time = 0;
        int frame = art_frame_max_frame(art);

        while (frame != 0) {
            sharedFpsLimiter.mark();

            if (elapsed_time(time) >= delay) {
                unsigned char* src = art_frame_data(art, frame - 1, 0);
                unsigned char* dest = interfaceBuffer + 640 * 38 + 580;
                if (src != NULL) {
                    buf_to_buf(src, 57, 58, 57, dest, 640);
                    win_draw_rect(interfaceWindow, &endWindowRect);
                }

                time = get_time();
                frame--;
            }
            gmouse_bk_process();

            renderPresent();
            sharedFpsLimiter.throttle();
        }
    } else {
        unsigned char* dest = interfaceBuffer + 640 * 38 + 580;
        unsigned char* src = art_frame_data(art, 0, 0);
        buf_to_buf(src, 57, 58, 57, dest, 640);
        win_draw_rect(interfaceWindow, &endWindowRect);
    }

    art_ptr_unlock(handle);
    endWindowOpen = false;
}

