static void op_critter_mod_skill(Program* program)
{
    int points = programStackPopInteger(program);
    int skill = programStackPopInteger(program);
    Object* critter = static_cast<Object*>(programStackPopPointer(program));

    if (critter != NULL && points != 0) {
        if (PID_TYPE(critter->pid) == OBJ_TYPE_CRITTER) {
            if (critter == obj_dude) {
                if (stat_pc_set(PC_STAT_UNSPENT_SKILL_POINTS, stat_pc_get(PC_STAT_UNSPENT_SKILL_POINTS) + points) == 0) {
                    for (int it = 0; it < points; it++) {
                        skill_inc_point(obj_dude, skill);
                    }
                }
            } else {
                dbg_error(program, "critter_mod_skill", SCRIPT_ERROR_FOLLOWS);
                debug_printf(" Can't modify anyone except obj_dude!");
            }
        }
    } else {
        dbg_error(program, "critter_mod_skill", SCRIPT_ERROR_OBJECT_IS_NULL);
    }

    programStackPushInteger(program, 0);
}

static int obj_use_book(Object* book)
{
    MessageListItem messageListItem;

    int messageId = -1;
    int skill;

    switch (book->pid) {
    case PROTO_ID_BIG_BOOK_OF_SCIENCE:
        // You learn new science information.
        messageId = 802;
        skill = SKILL_SCIENCE;
        break;
    case PROTO_ID_DEANS_ELECTRONICS:
        // You learn a lot about repairing broken electronics.
        messageId = 803;
        skill = SKILL_REPAIR;
        break;
    case PROTO_ID_FIRST_AID_BOOK:
        // You learn new ways to heal injury.
        messageId = 804;
        skill = SKILL_FIRST_AID;
        break;
    case PROTO_ID_SCOUT_HANDBOOK:
        // You learn a lot about wilderness survival.
        messageId = 806;
        skill = SKILL_OUTDOORSMAN;
        break;
    case PROTO_ID_GUNS_AND_BULLETS:
        // You learn how to handle your guns better.
        messageId = 805;
        skill = SKILL_SMALL_GUNS;
        break;
    }

    if (messageId == -1) {
        return -1;
    }

    if (isInCombat()) {
        // You cannot do that in combat.
        messageListItem.num = 902;
        if (message_search(&proto_main_msg_file, &messageListItem)) {
            display_print(messageListItem.text);
        }

        return 0;
    }

    int increase = (100 - skill_level(obj_dude, skill)) / 10;
    if (increase <= 0) {
        messageId = 801;
    } else {
        for (int i = 0; i < increase; i++) {
            if (stat_pc_set(PC_STAT_UNSPENT_SKILL_POINTS, stat_pc_get(PC_STAT_UNSPENT_SKILL_POINTS) + 1) == 0) {
                skill_inc_point(obj_dude, skill);
            }
        }
    }

    palette_fade_to(black_palette);

    int intelligence = stat_level(obj_dude, STAT_INTELLIGENCE);
    inc_game_time_in_seconds(3600 * (11 - intelligence));

    scr_exec_map_update_scripts();

    palette_fade_to(cmap);

    // You read the book.
    messageListItem.num = 800;
    if (message_search(&proto_main_msg_file, &messageListItem)) {
        display_print(messageListItem.text);
    }

    messageListItem.num = messageId;
    if (message_search(&proto_main_msg_file, &messageListItem)) {
        display_print(messageListItem.text);
    }

    return 1;
}

int skill_inc_point(Object* obj, int skill)
{
    Proto* proto;
    int unspent_skill_points;
    int level;
    int rc;

    if (obj != obj_dude) {
        return -5;
    }

    if (skill < 0 || skill >= SKILL_COUNT) {
        return -5;
    }

    proto_ptr(obj->pid, &proto);

    unspent_skill_points = stat_pc_get(PC_STAT_UNSPENT_SKILL_POINTS);
    if (unspent_skill_points <= 0) {
        return -4;
    }

    level = skill_level(obj, skill);
    if (level >= SKILL_LEVEL_MAX) {
        return -3;
    }

    rc = stat_pc_set(PC_STAT_UNSPENT_SKILL_POINTS, unspent_skill_points - 1);
    if (rc == 0) {
        proto->critter.data.skills[skill] += 1;
    }

    return rc;
}

int skill_dec_point(Object* critter, int skill)
{
    Proto* proto;
    int unspent_skill_points;
    int rc;

    if (critter != obj_dude) {
        return -5;
    }

    if (skill < 0 || skill >= SKILL_COUNT) {
        return -5;
    }

    proto_ptr(critter->pid, &proto);

    if (proto->critter.data.skills[skill] <= 0) {
        return -2;
    }

    unspent_skill_points = stat_pc_get(PC_STAT_UNSPENT_SKILL_POINTS);

    rc = stat_pc_set(PC_STAT_UNSPENT_SKILL_POINTS, unspent_skill_points + 1);
    if (rc == 0) {
        proto->critter.data.skills[skill] -= 1;
    }

    return 0;
}

